window.bookSummaryJSON = "<p><b>Wingman rule number one: don't fall for a client.</b> </p> <p>After a career-ending accident, former NFL recruit Ian Hunter is back on campus - and he's ready to get his new game on. As one of the masterminds behind Wingmen, Inc., a successful and secretive word-of-mouth dating service, he's putting his extensive skills with women to work for the lovelorn. But when Blake Olson requests the services of Wingmen, Inc., Ian may have landed his most hopeless client yet. </p> <p>From her frumpy athletic gear to her unfortunate choice of footwear, Blake is going to need a miracle if she wants to land her crush. At least with a professional matchmaker by her side she has a fighting chance. Ian knows that his advice and a makeover can turn Blake into another successful match. But as Blake begins the transformation from hot mess to smokin' hot, Ian realizes he's in danger of breaking his cardinal rule.... </p>"; 
